import{_ as e,c as o,o as t,a as i}from"./app.aecb249e.js";const a="/assets/join-tables.e3721cd5.png",m=JSON.parse('{"title":"Joining Data","description":"","frontmatter":{},"headers":[{"level":2,"title":"Joining multiple tables","slug":"joining-multiple-tables"}],"relativePath":"query/joining-data.md","lastUpdated":1682330664000}'),n={name:"query/joining-data.md"},l=i('<h1 id="joining-data" tabindex="-1">Joining Data <a class="header-anchor" href="#joining-data" aria-hidden="true">#</a></h1><p>To create insightful reports, you will need to combine data from multiple tables. Query Builder interface allows you to join any number of tables in a single query.</p><p>To join tables, you will first need to add a table, then click on the table name to open the join section where you can select the table you want to join with.</p><p><img src="'+a+'" alt="Join Tables"></p><h2 id="joining-multiple-tables" tabindex="-1">Joining multiple tables <a class="header-anchor" href="#joining-multiple-tables" aria-hidden="true">#</a></h2><p>To join multiple tables, you will need to join in a specific order. For example, if you want to join <code>users</code>, <code>orders</code>, <code>products</code>, and <code>categories</code> tables, you will need to join them in the following order:</p><ol><li>Add the <code>users</code> table to the query.</li><li>Then open the join section for the <code>users</code> table and select the <code>orders</code> table.</li><li>Now, add the <code>orders</code> table to the query.</li><li>Then open the join section for the <code>orders</code> table and select the <code>products</code> table.</li><li>Now, add the <code>products</code> table to the query.</li><li>Then open the join section for the <code>products</code> table and select the <code>categories</code> table.</li></ol>',7),d=[l];function s(c,r,h,p,u,_){return t(),o("div",null,d)}const g=e(n,[["render",s]]);export{m as __pageData,g as default};
